let parse input =
  input
  |> String.split_lines
  |> List.map ~f:String.strip
  |> List.map ~f:Shared.string_to_chars
  |> List.map ~f:Array.of_list
  |> Array.of_list
;;

let rec elevation_of c =
  match c with
  | 'S' -> elevation_of 'a'
  | 'E' -> elevation_of 'z'
  | _ -> Char.to_int c - Char.to_int 'a'
;;

