let find_S (grid : char array array) =
  Array.find_mapi
    ~f:(fun r xs ->
      match
        Array.find_mapi ~f:(fun c x -> if Char.equal x 'S' then Some c else None) xs
      with
      | Some c -> Some (r, c)
      | None -> None)
    grid
;;

